import React, { Component, Fragment } from 'react';
import Navbar from '../../UI/Navbar';

import './DAOffice.css';

class Budget extends Component {
    render () {
        return (
            <Fragment>
                <div className="home-wrapper">
                    <Navbar></Navbar>
                    <div className="container">
                        <div className="content-wrapper">
                            <h5>Budget</h5>
                            <p><a href="http://countyofsb.org/ceo/asset.c/3608">FY 2018-2019 Recommended Budget Book Pages</a></p>
                            
                            <p><a href="http://countyofsb.org/ceo/asset.c/2691">FY 2016-18 Budget Workshop Materials</a></p>

                            <p><a href="http://countyofsb.org/ceo/asset.c/2819">FY 2016-18 Recommended
                            Budget Book Pages</a></p>

                            <p><a href="http://countyofsb.org/ceo/asset.c/2352">FY 2015-17 Budget Workshop Materials</a></p>

                            <p><a href="http://countyofsb.org/ceo/asset.c/2449">FY 2015-17 Recommended Budget Book Pages</a></p>

                            <p><a href="http://countyofsb.org/ceo/asset.c/1449">FY 2014-16 Budget Workshop Materials</a></p>

                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default Budget;
